import React from 'react'
import "./User.css"

export default function User() {
  return (
    <div className="User">
        <div className="userTitleContainer">
          <h2 className='userTitle'>Gebruiker Bijwerken</h2>
          <button className="userAddButton">Nieuwe gebruiker</button>
        </div>

    </div>
  )
}
